<div id="calculator" ref="calculator">
	<header 
		@mousedown="startDrag($event)"
		@touchmove="touchMove($event)"
		class="grab-header"
		ref="grab">
		Damage calculator
		<div class="reverse-info-box calculator-help">
			?
			<span class="info-box-text">Hold down "A" or "D" while clicking a unit to add it to the calculator</span>
		</div>
		<span class="close-calc">&#10005;</span>
	</header>
	<!-- Content is unloaded if calculator is not shown -->
	<div class="calc-content" v-if="toggled">
		<div class="headers">
			<header>Attacker
				<span
					class="select-attacker"
					ref="select-attacker"
					@click="selectUnit('attacker')">
					[Select]
				</span>
				<span 
					class="swap-position"
					@click="swapPosition()">
					[Swap]
				</span>
			</header>
			<header>Defender
				<span
					class="select-defender"
					ref="select-defender"
					@click="selectUnit('defender')">
					[Select]
				</span>
			</header>
		</div>
		<div class="calculator-main">
			<div class="calculator-attack">
				<div class="co-options">
					<div 
						class="co option"
						@click="toggleMenu('attacker', 'co')">
						<div class="selected-co">
							<img class="border" :src="'terrain/aw2/' + coTheme + attacker.co.co_name.toLowerCase() + '.png'">
						</div>
						<div class="co-menu" v-if="menuToggles.attacker.co"> 
							<img 
								v-for="co in cos"
								:src="'terrain/aw2/' + coTheme + co.co_name.toLowerCase() + '.png'"
								@click="attacker.co = co">
						</div>
					</div>
				</div>
				<div class="unit-options">
					<div
						class="unit option"
						@click="toggleMenu('attacker', 'unit')">
						<div class="selected-unit border">
							<img :src="terrainPath + attacker.country.code + attacker.unit.units_name.toLowerCase() + '.gif'">
							<img
								v-if="attacker.hp === '?' || (attacker.hp && attacker.hp > 0 && attacker.hp < 10)"
								:src="'terrain/aw2/' + attackerHpDisplay + '.gif'"
								class="hp-display">
						</div>
						<div class="unit-menu" v-if="menuToggles.attacker.unit">
							<img
								v-for="unit in units"
								:src="terrainPath + attacker.country.code + unit.units_name.toLowerCase() + '.gif'"
								@click="attacker.unit = unit">
						</div>
					</div>
					<div class="hp-options">
						<img src="terrain/hp.gif">
						<input 
							type="text"
							v-model="attacker.hp">
					</div>
				</div>
				<div class="terrain-options">
					<div
						class="terrain option"
						@click="toggleMenu('attacker', 'terrain')">
						<img class="selected-terrain" :src="`terrain/aw2/${attacker.terrain.terrain_name.toLowerCase()}.gif`">
						<div class="terrain-menu" v-if="menuToggles.attacker.terrain">
							<img
								v-for="terrain in terrain"
								:src="terrainPath + terrain.terrain_name.toLowerCase() + '.gif'"
								@click="attacker.terrain = terrain">
						</div>
						<div class="terrain-stars">
							<img src="terrain/terrainstar.gif">
							<p>{{attacker.co.co_name === "Lash" && attacker.power === "S" ?  attacker.terrain.terrain_defense * 2 : attacker.terrain.terrain_defense}}</p>
						</div>
					</div>
				</div>
				<div class="power-options">
					<div class="option">
						<img
							:class="{'green-border': attacker.power == 'Y' ? true : false}" 
							@click="changePower('attacker', 'Y', $event)" 
							src="terrain/aw2/redstar.gif"
							ref="attacker-cop">
						<img
							:class="{'green-border': attacker.power == 'S' ? true : false}"
							@click="changePower('attacker', 'S', $event)" 
							src="terrain/aw2/bluestar.gif"
							ref="attacker-scop">
					</div>
				</div>
				<div class="misc-options">
					<div class="city-options">
						<img src="terrain/capt.gif">
						<input
							type="text"
							v-model="attacker.cities"
							max="100"
							min="0">
					</div>
					<div class="tower-options">
						<img src="terrain/aw2/commtowericon.gif">
						<input
							type="text"
							v-model="attacker.towers"
							max="100"
							min="0">
					</div>
					<div class="fund-options">
						<img class="coin" src="terrain/coin.gif">
						<input
							type="text"
							v-model="attacker.funds"
							min="0">
					</div>
				</div>
			</div>
			<div class="calculator-defend">
				<div class="co-options">
					<div 
						class="co option"
						@click="toggleMenu('defender', 'co')">
						<div class="selected-co">
							<img class="border" :src="'terrain/aw2/' + coTheme + defender.co.co_name.toLowerCase() + '.png'">
						</div>
						<div class="co-menu" v-if="menuToggles.defender.co"> 
							<img 
								v-for="co in cos"
								:src="'terrain/aw2/' + coTheme + co.co_name.toLowerCase() + '.png'"
								@click="defender.co = co">
						</div>
					</div>
				</div>
				<div class="unit-options">
					<div
						class="unit option"
						@click="toggleMenu('defender', 'unit')">
						<div class="selected-unit border">
							<img :src="terrainPath + defender.country.code + defender.unit.units_name.toLowerCase() + '.gif'">
							<img
								v-if="defender.hp === '?' || (defender.hp && defender.hp < 10)"
								:src="'terrain/aw2/' + defenderHpDisplay + '.gif'"
								class="hp-display">
						</div>
						<div class="unit-menu" v-if="menuToggles.defender.unit">
							<img
								v-for="unit in units"
								:src="terrainPath + defender.country.code + unit.units_name.toLowerCase() + '.gif'"
								@click="defender.unit = unit">
						</div>
					</div>
					<div class="hp-options">
						<img src="terrain/hp.gif">
						<input 
							type="text"
							v-model="defender.hp"
							max="10"
							min="1">
					</div>
				</div>
				<div class="terrain-options">
					<div
						class="terrain option"
						@click="toggleMenu('defender', 'terrain')">
						<img class="selected-terrain" :src="terrainPath + defender.terrain.terrain_name.toLowerCase() + '.gif'">
